	build_tree(t);
	int *u = (int *)malloc(sizeof(int) * M);
	int *v = (int *)malloc(sizeof(int) * M);
	for(i = 0; i < M; i++){
		scanf("%d%d", &u[i], &v[i]);
		u[i]--;
		v[i]--;
	}
	data_LCA **datas = reserve_LCA(t);
	int *sum = (int *)malloc(sizeof(int) * N);
	int *up = (int *)malloc(sizeof(int) * N);
	int *down = (int *)malloc(sizeof(int) * N);
	for(i = 0; i < N; i++){
		sum[i] = 0;
		up[i] = 0;
		down[i] = 0;
	}
	tree_vertex *nowv;
	for(i = 0; i < M; i++){
		nowv = t->v[u[i]];
		while(nowv != NULL){
			sum[nowv->num]++;
			nowv = nowv->parent;
		}
		nowv = t->v[v[i]];
		while(nowv != NULL){
			sum[nowv->num]++;
			nowv = nowv->parent;
		}
		nowv = t->v[LCA(u[i], v[i], datas)];
		while(nowv != NULL){
			sum[nowv->num] -= 2;
			nowv = nowv->parent;
		}
	}
	int T = 0;
	for(i = 0; i < N; i++){
		T += min(sum[i], 2);
	}
	printf("%d\n", T);

	int now, dir, lcau, lcav;
	int *u_ans = (int *)malloc(sizeof(int) * M);
	int *v_ans = (int *)malloc(sizeof(int) * M);
	for(i = 0; i < M; i++){
		u_ans[i] = -1;
		v_ans[i] = -1;
	}
	while(1){
		now = -1;
		for(i = 0; i < N; i++){
			if(sum[i] == up[i] + down[i] + 1 && sum[i] >= 2){
				if(up[i] == 0){
					now = i;
					dir = 1;
					break;
				}
				if(down[i] == 0){
					now = i;
					dir = -1;
					break;
				}
			}
		}
		if(now == -1){
			for(i = 0; i < N; i++){
				if(sum[i] > up[i] + down[i]){
					now = i;
					dir = 1;
					break;
				}
			}
		}
		if(now == -1){
			break;
		}
		for(i = 0; i < M; i++){
			if(u_ans[i] == -1){
				lcau = LCA(u[i], now, datas);
				lcav = LCA(v[i], now, datas);
				if(lcau == now && lcav != now){
					j = i;
					break;
				}
				if(lcau != now && lcav == now){
					j = i;
					dir *= -1;
					break;
				}
			}
		}
		if(dir == 1){
			u_ans[j] = u[j];
			v_ans[j] = v[j];
		}
		else{
			u_ans[j] = v[j];
			v_ans[j] = u[j];
		}
		nowv = t->v[u[j]];
		while(nowv != NULL){
			if(dir == 1){
				up[nowv->num]++;
			}
			else{
				down[nowv->num]++;
			}
			nowv = nowv->parent;
		}
		nowv = t->v[v[j]];
		while(nowv != NULL){
			if(dir == 1){
				down[nowv->num]++;
			}
			else{
				up[nowv->num]++;
			}
			nowv = nowv->parent;
		}
		nowv = t->v[LCA(u[j], v[j], datas)];
		while(nowv != NULL){
			up[nowv->num]--;
			down[nowv->num]--;
			nowv = nowv->parent;
		}
	}
	for(i = 0; i < M; i++){
		printf("%d %d\n", u_ans[i] + 1, v_ans[i] + 1);
	}
	return 0;
